    return <div>
        <h1>Hello</h1>
        {products && products.map((product, idx) => {
            <div key={idx}> {product.name}</div>
            { console.log("Name", product.name) }
            { console.log("Price", product.price) }
        })}

    </div>;
};

export default Products;
